import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@material-ui/core/styles';
import Divider from '@material-ui/core/Divider';
import Drawer from '@material-ui/core/Drawer';
import List from '@material-ui/core/List';
import HomeIcon from '@material-ui/icons/Home';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import JournalIcon from '@material-ui/icons/Message'
import PeopleIcon from '@material-ui/icons/Person';
import WriteIcon from '@material-ui/icons/Create';
import EmotionIcon from '@material-ui/icons/Mood';
import PatternIcon from '@material-ui/icons/AllInclusive';
import InfoIcon from '@material-ui/icons/DonutSmall';
import {Link} from 'react-router-dom';
import {withRouter} from 'react-router';
import {compose} from 'recompose';

const categories = [
  {
    id: "Menu",
    children: [
      { id: 'Entries', icon: <JournalIcon />, link: '/' },
      { id: 'Add Entry', icon: <WriteIcon /> , link:'/entries'},
      { id: 'Add Emotion', icon: <EmotionIcon /> , link:'/emotions'},
      { id: 'Thought Patterns', icon: <PatternIcon /> , link:'/patterns'},
      { id: 'Profile', icon: <PeopleIcon />, link: '/profile'},
      { id: 'About', icon: <InfoIcon />, link: '/about'}
    ],
  },
];

const styles = theme => ({
  categoryHeader: {
    paddingTop: theme.spacing(2),
    paddingBottom: theme.spacing(2),
  },
  categoryHeaderPrimary: {
    color: theme.palette.common.white,
  },
  item: {
    paddingTop: 1,
    paddingBottom: 1,
    color: 'rgba(255, 255, 255, 0.7)',
    '&:hover,&:focus': {
      backgroundColor: 'rgba(255, 255, 255, 0.08)',
    },
  },
  itemCategory: {
    backgroundColor: '#232f3e',
    boxShadow: '0 -1px 0 #404854 inset',
    paddingTop: theme.spacing(2),
    paddingBottom: theme.spacing(2),
  },
  firebase: {
    fontSize: 24,
    color: theme.palette.common.white,
  },
  itemActiveItem: {
    color: '#4fc3f7',
  },
  itemPrimary: {
    fontSize: 'inherit',
  },
  itemIcon: {
    minWidth: 'auto',
    marginRight: theme.spacing(2),
  },
  list: {
    marginTop: '20px',
  },
  divider: {
    marginTop: theme.spacing(2),
  },
});



function Navigator(props) {
  const { classes, location:{pathname}, staticContext, ...other } = props;

  return (
    <Drawer variant="permanent" {...other}>
      <List disablePadding>
        <ListItem className={clsx(classes.firebase, classes.item, classes.itemCategory)}>
          Cerebral
        </ListItem>
        <ListItem className={clsx(classes.item, classes.itemCategory)}>
          <ListItemIcon className={classes.itemIcon}>
            <HomeIcon />
          </ListItemIcon>
          <ListItemText
            classes={{
              primary: classes.itemPrimary,
            }}
          >
            Home
          </ListItemText>
        </ListItem>
        {categories.map(({ id, children }) => (
          <React.Fragment key={id}>
            <div className={classes.list}>
            {children.map(({ id: childId, icon, link }) => (
              <ListItem
                key={childId}
                button
                component={Link}
                to = {link}
                className={clsx(classes.item, pathname===link && classes.itemActiveItem)}
              >
                <ListItemIcon className={classes.itemIcon}>{icon}</ListItemIcon>
                <ListItemText
                  classes={{
                    primary: classes.itemPrimary,
                  }}
                >
                  {childId}
                </ListItemText>
              </ListItem>
            ))}
            </div>
            <Divider className={classes.divider} />
          </React.Fragment>
        ))}
      </List>
    </Drawer>
  );
}

Navigator.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default compose(
  withRouter,
  withStyles(styles)
)(Navigator)
